    of disbursement should be noted as: In-Kind Consulting Services (see Line 23 item).
    \ These amounts relate to an original $8,000.00 advance payment made to the National
    Association of Realtors for consulting services on 9/13/2010 and reported on Line
    21b of the October 2010 monthly report.  Subsequently in 2010, we utilized $6,200.00
    of this advanced payment as consulting services attributable to independent expenditures
    & reflected as negative amounts subtracted from Line 21b and transferred to Line
    24.  In 2011, we applied $700.00 of this advance payment for consulting services
    attributable to In-Kind events & reflected as negative amounts subtracted from
    Line 21b and transferred to Line 23.  In the current November 2011 reporting period,
    a total of $700.00 of the original $8,000.00 is being utilized as consulting services
